import React, { useState, useEffect } from 'react';
import '../index.css'
import 'bootstrap/dist/css/bootstrap.min.css';
import axios from 'axios';
import { useNavigate, Link } from 'react-router-dom';
import LogoutButton from './LogoutButton';

import { getUserName, getCollections, getLike, setComment } from './utility';

import logo_light from '../images/logo_light.jpg'
import 'bootstrap-icons/font/bootstrap-icons.css';
import { useParams } from 'react-router-dom'; //доступ к параметрам url

const [loading, setLoading] = useState(true);

const apiUrl = process.env.REACT_APP_API_URL;

const CreateCollection = () => {
  const { id } = useParams(); //тут берется id нужной коллекции
  const navigate = useNavigate();
  const [userName, setUserName] = useState('');
  const [userId, setUserId] = useState(null);
  const [isLiked, setIsLiked] = useState(false);
  const [likesCount, setLikesCount] = useState(0);
  const [collection, setCollection] = useState(null);

  const [comments, setComments] = useState([]);
  const [newComment, setNewComment] = useState('');

  useEffect(() => {
    getUserName(setUserName, setUserId);
    if (id) {
      if(collection){
        setComments(collection.comments);
      }
      getCollections(setCollection, '/api/collectionEditView/viewCollection', id);
    }
    
  }, [navigate, isLiked, likesCount, id]); /*, collection*/

  const handleLogin = () => {
    navigate('/login');
  };
  const handleHomePage = () => {
    navigate('/collections');
  };
  const handleProfile = () => {
    navigate(`/profile/${userId}`);
  };
  const handleSubmitComment = async () => {
    const res = await setComment(id, newComment); 
    if (res && res.data){
      setComments(prevComments => [...prevComments, res.data]);

      setNewComment('');
      getCollections(setCollection, '/api/collectionEditView/viewCollection', id);
    }
  };
  const toggleLike = async (id) => {
    setIsLiked(prev => !prev);
    setLikesCount(prev => isLiked ? prev - 1 : prev + 1);

    try{
      const res = await getLike(id, setIsLiked);
      //console.error('step 1', res);
      if(res.status != 200){
        setIsLiked(prev => !prev);
        setLikesCount(prev => isLiked ? prev + 1 : prev - 1);
      }
    }
    catch(err){
      console.error('error like/dislike 57', err);
      setIsLiked(prev => !prev);
      setLikesCount(prev => isLiked ? prev + 1 : prev - 1);
    }
  };

  if (loading) {
    return <div>Loading...</div>; 
  }

  return (

    <div className="container">
      <h2>{collectionId ? 'Edit Collection' : 'Create New Collection'}</h2>
      <form onSubmit={handleSubmit}>
        <div className="mb-3">
          <label htmlFor="title" className="form-label">Title</label>
          <input
            type="text"
            id="title"
            className="form-control"
            value={title}
            onChange={(e) => setTitle(e.target.value)}
            required
          />
        </div>
        <div className="mb-3">
          <label htmlFor="description" className="form-label">Description</label>
          <textarea
            id="description"
            className="form-control"
            value={description}
            onChange={(e) => setDescription(e.target.value)}
            required
          />
        </div>
        <div className="mb-3">
          <label htmlFor="imageUrl" className="form-label">Image URL</label>
          <input
            type="text"
            id="imageUrl"
            className="form-control"
            value={imageUrl}
            onChange={(e) => setImageUrl(e.target.value)}
          />
        </div>
        {error && <div className="alert alert-danger">{error}</div>}
        <button type="submit" className="btn btn-primary">
          {collectionId ? 'Save Changes' : 'Create'}
        </button>
      </form>
    </div>
  );
};

export default CreateCollection;
